import React, {Component, Fragment} from 'react';
import './App.css';

class App extends Component {
  render(){
    const name = "Mahitha";
    foo = ()=>{return "Bars"};

    return (

      <div className="App">
        <h1>Hello world, {name}</h1>
        <h2>this.foo()}</h2>
      </div>
    );
  }
}

export default App;
